import { Routes, Route } from "react-router-dom";
import { HulkNavbar } from "../components/common/navbar/HulkNavbar";

import Inicio from "../pages/Inicio";

const RouterDos = () => {
  return (
    <>
      <HulkNavbar />
      <Routes>
        <Route exact path="/" element={<Inicio />} />
      </Routes>
    </>
  );
};

export default RouterDos;
